  false,\n\t\"url\": null,\n\t\"notes\": \"TASK NAME: USGS New Jersey CMGP Sandy Lidar
  0.7 Meter NPS LIDAR lidar Data Acquisition and Processing Production Task USGS Contract
  No. G10PC00057 Task Order No. G13PD00854 Woolpert Order No. 073714 CONTRACTOR: Woolpert,
  Inc. This task is issued under Contract Number G10PC00057, as task order number
  G13PD00854. This task order requires lidar data to be acquired over several areas
  in New Jersey to include the entire counties of Bergen, Essex, Hudson, Middlesex,
  Monmouth, and Union and including Morristown National Historical Park are part of
  the New Jersey area of interest (AOI), and will be acquired as part of this task
  order. The total area of the New Jersey Sandy Lidar AOI is approximately 1312 square
  miles. The lidar was collected and processed to meet a maximum Nominal Post Spacing
  (NPS) of 0.7 meters. The NPS assessment is made against single swath, first return
  data located within the geometrically usable center portion (typically nearly 90
  percent) of each swath. This acquisition was part of a larger effort designed to
  capture one other USGS task order AOI in New York. York.\",\n\t\"license_title\":
